import React from "react";
const Navbar = () => {

  return (
    <div class="navbar">
    <div class="logo">My Website</div>
    <ul class="nav-links">
      <li>Home</li>
      <li>About</li>
      <li>Contact</li>
    </ul>
    <div class="hamburger">
      &#9776; 
    </div>
  </div>
  
  );
};

export default Navbar;
